import React from 'react';

const menu_bar = () => {
    return (
        <nav>
            <ul>
                <li>home</li>
                <li>about</li>
                <li>portfolio</li>
                <li>blog</li>
                <li>contact</li>
            </ul>
        </nav>
    );
};

export default menu_bar;
